function getLowestFaderValue()
{
  let minFaderValue = 12;
  for(let i=1;i<=32;i++)
  {
    if (get('volumebutton'+i)===1)
    {
      let id = 'track/'+i+'/volume/db'
      let faderValue = get(id);
      if (faderValue<minFaderValue)
        minFaderValue = faderValue
    }
  }
  return minFaderValue
}

function mapValue(x) {
  // Calculate the factor ln(100)/150 once
  const factor = Math.log(100) / 150;
  return Math.exp(-x * factor);
}

let lowestFaderValue = getLowestFaderValue()

let scalingFactor = mapValue(lowestFaderValue)

